/*Table structure for table `group_info` */

DROP TABLE IF EXISTS `group_info`;

CREATE TABLE `group_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '群组id,自增主键',
  `name` varchar(32) NOT NULL COMMENT '群组名',
  `group_desc` varchar(128) DEFAULT NULL COMMENT '群组描述',
  `group_status` varchar(8) NOT NULL COMMENT '群组状态（ON,OFF）',
  `img_name` varchar(64) DEFAULT NULL COMMENT '群组头像名称',
  `img_url` varchar(256) DEFAULT NULL COMMENT '群组头像地址',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='家庭组';

/*Data for the table `group_info` */

