/*Table structure for table `user_info` */

DROP TABLE IF EXISTS `user_info`;

CREATE TABLE `user_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `name` varchar(32) NOT NULL COMMENT '姓名',
  `password` varchar(128) NOT NULL COMMENT '密码（登录用）',
  `sex` varchar(4) NOT NULL COMMENT '性别',
  `age` int(11) NOT NULL COMMENT '年龄',
  `birth` date NOT NULL COMMENT '出生年月日',
  `address` varchar(128) DEFAULT NULL COMMENT '现住址',
  `phone` varchar(32) NOT NULL COMMENT '电话号码',
  `email` varchar(64) NOT NULL COMMENT '邮箱',
  `father_id` int(11) DEFAULT NULL COMMENT '父id',
  `mother_id` int(11) DEFAULT NULL COMMENT '母id',
  `user_desc` varchar(1024) DEFAULT NULL COMMENT '个人描述',
  `acct_type` int(1) NOT NULL COMMENT '账户类型（0:不可关闭账户，1：普通账户）',
  `acct_status` varchar(8) NOT NULL COMMENT '账户状态（ON,OFF）',
  `img_name` varchar(64) DEFAULT NULL COMMENT '个人头像(存储image表的name字段)',
  `img_url` varchar(256) DEFAULT NULL COMMENT '个人头像(存储服务器端的存储路径)',
  `im` varchar(8) NOT NULL COMMENT 'IM是否开启（ON,OFF）',
  `sign` varchar(64) DEFAULT NULL COMMENT '个人签名',
  `reserved1` varchar(128) DEFAULT NULL COMMENT '扩展字段',
  `reserved2` varchar(128) DEFAULT NULL COMMENT '扩展字段',
  PRIMARY KEY (`id`)
