/*Table structure for table `user_login_info` */

DROP TABLE IF EXISTS `user_login_info`;

CREATE TABLE `user_login_info` (
  `user_id` int(11) NOT NULL COMMENT '主键，也是外键连接用户id',
  `ONLINE_STATUS` varchar(8) DEFAULT NULL COMMENT '当前在线状态（ON,OFF）',
  `logout_time` datetime DEFAULT NULL COMMENT '最近一次登出时间',
  `login_time` datetime DEFAULT NULL COMMENT '本次登录时间',
  `last_login_time` datetime DEFAULT NULL COMMENT '上次登录时间',
  `login_ip` varchar(32) DEFAULT NULL COMMENT '本次登录IP',
  `last_login_ip` varchar(32) DEFAULT NULL COMMENT '上次登录IP',
  `login_address` varchar(64) DEFAULT NULL COMMENT '本次登录地址',
  `last_login_address` varchar(64) DEFAULT NULL COMMENT '上次登录地址',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='家庭用户登录状态表';

